import React from "react";
import "./currentlyviewing.css"

import Button from '@material-ui/core/Button';
import { makeStyles } from '@material-ui/core/styles';
//import Grid from '@material-ui/core/Grid';

const CurrentlyViewing = (props) => {
    const useStyles = makeStyles(theme => ({ //button styling
        root: {
            color: "#28244E",
            borderColor: "#28244E",
            fontSize: "1.5em",
            borderWidth: "5px",
            borderRadius: "16px",
            marginTop: "5px",

            '&:hover': {
                color: "#3ACBA3 ",
                borderColor: "white",
                fontSize: "1.5em",
                borderWidth: "5px",
            },

        }
    }));
    const classes = useStyles();

    return (
        <div className="current_view_wrapper">

            <p>  See @{props.handle}'s feed below</p>



        </div>
    )
}

export default CurrentlyViewing;
